B.C4=new A.ba(B.fQ,["11007","Margarita",null,"IBA,ContemporaryClassic",null,"Ordinary Drink","Contemporary Classics","Alcoholic","Cocktail glass","Rub the rim of the glass with the lime slice to make the salt stick to it. Take care to moisten only the outer rim and sprinkle the salt on it. The salt should present to the lips of the imbiber and never mix into the cocktail. Shake the other ingredients with ice, then carefully pour into the glass.",null,"Reiben Sie den Rand des Glases mit der Limettenscheibe, damit das Salz daran haftet. Achten Sie darauf, dass nur der \xe4u\xdfere Rand angefeuchtet wird und streuen Sie das Salz darauf. Das Salz sollte sich auf den Lippen des Genie\xdfers befinden und niemals in den Cocktail einmischen. Die anderen Zutaten mit Eis sch\xfctteln und vorsichtig in das Glas geben.",null,"Strofina il bordo del bicchiere con la fetta di lime per far aderire il sale.\r\nAvere cura di inumidire solo il bordo esterno e cospargere di sale.\r\nIl sale dovrebbe presentarsi alle labbra del bevitore e non mescolarsi mai al cocktail.\r\nShakerare gli altri ingredienti con ghiaccio, quindi versarli delicatamente nel bicchiere.",null,null,"https://www.thecocktaildb.com/images/media/drink/5noda61589575158.jpg","Tequila","Triple sec","Lime juice","Salt",null,null,null,null,null,null,null,null,null,null,null,"1 1/2 oz ","1/2 oz ","1 oz ",null,null,null,null,null,null,null,null,null,null,null,null,"https://commons.wikimedia.org/wiki/File:Klassiche_Margarita.jpg","Cocktailmarler","Yes","2015-08-18 14:42:59"],t.D9)
